import React from 'react';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import { CPage, CLogo } from "@appcues/component-library";
import './App.css';

function App() {
  return (
    <Router>
    <CLogo/>
    Welcome to Appcues
    <Switch>
    <Route path="/analytics">
    </Route>
    <Route path="/">
    <CPage>
      This is your home 
    </CPage>
    </Route>
    </Switch>
    </Router>
  );
}

export default App;
